import web from "./Images/seed.png";
import game from "./Images/retro maze1.png";

const ProjectData = [
  {
    imgsrc: web,
    title: "EcoSwap",
    text:
      "E-commerce Website that promotes donating and paying it forward to the community for a sustainable future. This website was built using HTML, JavaScript, and CSS",
    url: "https://github.com/maahasghar/RBC_Hacks_NGI-",
  },

  {
    imgsrc: game,
    title: "Retro Maze Game",
    text:
      "It's a two-player game: Donkey must to find exit before shrek catches him. This game was built as a part of course project using C/C++, and raspberry pi.",
    url: "https://github.com/maahasghar/Retro_Maze",
  },
];

export default ProjectData;
